import unittest

from insane_triangels import triangle

'''
https://www.codewars.com/kata/5a331ea7ee1aae8f24000175/train/python
'''


class InsaneTriangleTest(unittest.TestCase):
    def test_single(self):
        self.assertEqual(triangle('B'), 'B')

    def test_two(self):
        self.assertEqual(triangle('RG'), 'B')

    def test_three(self):
        self.assertEqual(triangle('RRR'), 'R')

    def test_four(self):
        self.assertEqual(triangle('RGBG'), 'B')

    def test_longer(self):
        self.assertEqual(triangle('RBRGBRB'), 'G')

    def test_insane(self):
        self.assertEqual(
            triangle(
                ''),
            'G')


if __name__ == '__main__':
    unittest.main()
